import { Avatar } from "@chakra-ui/react";
import React from "react";
import { Container } from "react-bootstrap";

const Navbar = () => {
  return (
    <Container>
      <MenuButton>
        <Avatar />
      </MenuButton>
      <MenuList>
        <MenuItem>Profile</MenuItem>
        <MenuItem>Sttings</MenuItem>
      </MenuList>
    </Container>
  );
};

export default Navbar;
